import React, { Component } from 'react';
import Slider from "react-slick";

class Case extends Component {
    render() {
        const slider_adopt = {
            infinite: true,
            fade: true,
            slidesToShow: 3,
            slidesToScroll: 3,
            speed: 500
        };
        return (
            <section className="top-products">
                <div className="container">
                    <h1 className="section-heading">Adoption</h1>
                    <div class="slider-adoption">
                        <Slider className="food-slider" {...slider_adopt}>
                         <div class="food-card magic-shadow-sm">

                         </div>
                         <div class="food-card magic-shadow-sm">
                             
                         </div>
                        </Slider>
                    </div>
                </div>
            </section>
        );
    }
}


export default Case;
